import React, { useState, useEffect } from 'react';
import { Box, TextField, Button, Paper, Typography, Container, CircularProgress, Card, CardContent, CardActions } from '@mui/material';
import RealEstateService from '../services/realEstateService';

const ChatInterface = () => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [loading, setLoading] = useState(false);
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    // Add initial greeting
    setMessages([
      {
        id: 1,
        text: "Hello! I'm your AI real estate assistant. How can I help you find your dream property today?",
        sender: 'agent',
        timestamp: new Date().toISOString(),
      },
    ]);
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!input.trim()) return;

    const userMessage = {
      id: messages.length + 1,
      text: input,
      sender: 'user',
      timestamp: new Date().toISOString(),
    };

    setMessages((prev) => [...prev, userMessage]);
    setInput('');
    setLoading(true);

    try {
      let response;
      
      // Check if it's a negotiation message
      if (input.toLowerCase().includes('offer')) {
        const propertyId = extractPropertyId(input);
        const offerAmount = extractOfferAmount(input);
        if (propertyId && offerAmount) {
          response = await RealEstateService.negotiatePrice(propertyId, offerAmount);
          // Handle negotiation response
          const agentMessage = {
            id: messages.length + 2,
            text: response.negotiation?.response || response.message || "Negotiation in progress",
            sender: 'agent',
            timestamp: new Date().toISOString(),
          };
          setMessages((prev) => [...prev, agentMessage]);
          return;
        }
      }

      // Default to property search
      response = await RealEstateService.searchProperties(input);
      const agentMessage = {
        id: messages.length + 2,
        text: response.message,
        sender: 'agent',
        timestamp: new Date().toISOString(),
      };

      setMessages((prev) => [...prev, agentMessage]);
      if (response.properties) {
        setProperties(response.properties.map(p => ({ ...p, showAmenities: false })));
      }
    } catch (error) {
      console.error('Error:', error);
      const errorMessage = {
        id: messages.length + 2,
        text: 'Sorry, I encountered an error. Please try again.',
        sender: 'agent',
        timestamp: new Date().toISOString(),
      };
      setMessages((prev) => [...prev, errorMessage]);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="md">
      <Box sx={{ height: '100vh', py: 4 }}>
        <Paper elevation={3} sx={{ height: '80vh', p: 2, display: 'flex', flexDirection: 'column' }}>
          <Box sx={{ flexGrow: 1, overflow: 'auto', mb: 2 }}>
            {messages.map((message) => (
              <Box
                key={message.id}
                sx={{
                  display: 'flex',
                  justifyContent: message.sender === 'user' ? 'flex-end' : 'flex-start',
                  mb: 2,
                }}
              >
                <Paper
                  sx={{
                    p: 2,
                    backgroundColor: message.sender === 'user' ? '#e3f2fd' : '#f5f5f5',
                    maxWidth: '70%',
                  }}
                >
                  <Typography variant="body1">{message.text}</Typography>
                </Paper>
              </Box>
            ))}
          </Box>

          {properties.length > 0 && (
            <Box sx={{ mb: 2, maxHeight: '300px', overflow: 'auto' }}>
              <Typography variant="h6" sx={{ mb: 1 }}>Found Properties:</Typography>
              {properties.map((property) => (
                <Card key={property.id} sx={{ mb: 2 }}>
                  <CardContent>
                    <Typography variant="h6" component="div">
                      {property.address}
                    </Typography>
                    <Typography sx={{ mb: 1.5 }} color="text.secondary">
                      {property.city}, {property.state}
                    </Typography>
                    <Typography variant="body2">
                      ${property.price.toLocaleString()} • {property.bedrooms} bed • {property.bathrooms} bath • {property.square_feet} sqft
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Type: {property.property_type}
                    </Typography>
                    {property.showAmenities && property.amenities && (
                      <Box sx={{ mt: 1 }}>
                        <Typography variant="subtitle2">Amenities:</Typography>
                        <Typography variant="body2">{property.amenities.join(', ')}</Typography>
                      </Box>
                    )}
                  </CardContent>
                  <CardActions>
                    <Button
                      size="small"
                      onClick={async () => {
                        try {
                          const response = await RealEstateService.getPropertyAmenities(property.id);
                          setProperties(prev => prev.map(p =>
                            p.id === property.id
                              ? { ...p, showAmenities: !p.showAmenities, amenities: response.amenities }
                              : p
                          ));
                        } catch (error) {
                          console.error('Error fetching amenities:', error);
                        }
                      }}
                    >
                      {property.showAmenities ? 'Hide Amenities' : 'Show Amenities'}
                    </Button>
                    <Button
                      size="small"
                      onClick={() => {
                        setInput(`I want to make an offer on the property at ${property.address}`);
                      }}
                    >
                      Make Offer
                    </Button>
                  </CardActions>
                </Card>
              ))}
            </Box>
          )}

          <Box component="form" onSubmit={handleSubmit} sx={{ display: 'flex', gap: 1 }}>
            <TextField
              fullWidth
              value={input}
              onChange={(e) => setInput(e.target.value)}
              placeholder="Type your message..."
              disabled={loading}
            />
            <Button type="submit" variant="contained" disabled={loading}>
              {loading ? <CircularProgress size={24} /> : 'Send'}
            </Button>
          </Box>
        </Paper>
      </Box>
    </Container>
  );
};

export default ChatInterface;
